import React from "react";
import { MainPage } from "./main_page/MainPage";
import { Route, Routes } from "react-router-dom";

import { ControlPages } from "../general_compo/ControlPages";
import { Register } from "./authorization/register/Register";
import { Exit } from "../layouts/header/dropdown/Exit";
import { Route_between_pages } from "./Route_between_pages";

//برای اینکه شلوغ نشه روتر صفحه ها رو بردم تو یک کامپوننت دیگه 😉

export const Admin = () => {
  return (
    <div>
        <Route_between_pages />
      <Routes>

        {/* ==================    register    ======================= */}
        <Route path="/register" element={<Register />} />

        {/* ====================================================== */}

        <Route path="/exit" element={<Exit />} />

        {/* ====================================================== */}

        <Route path="*" element={<ControlPages namePage={<MainPage />} />} />
      </Routes>
    </div>
  );
};
